import React from 'react';
import * as sampleConfig from 'sample';

import Grid from './components/Grid';

function App() {
  return (
    <div className="App">
      <h1>Row</h1>
      <Grid id="test" direction="row">
        <Grid id="test1" width="50%">
          test 1
        </Grid>
        <Grid id="test2">test 2</Grid>
        <Grid id="test3">test 3</Grid>
      </Grid>
      <h1>Column</h1>
      <Grid direction="column">
        <Grid>test 1</Grid>
        <Grid height="200px">test 2</Grid>
        <Grid>test 3</Grid>
      </Grid>
    </div>
  );
}
export default App;
